SELECT  [activityId] AS [ActivityID]
       ,[activityName] AS [ActivityName]
       ,LEFT(DATENAME(WEEKDAY, [startTimeLocal]), 3) AS [ActivityDay]
       ,[startTimeLocal] AS [StartTime]
       ,[startTimeGMT] AS [StartTimeGMT]
       ,[activityType] AS [ActivityType]
       ,[eventType] AS [EventType]
       ,FORMAT([distance] / 1000, '#,0.00 KM') AS [DistanceKM]
       ,FORMAT(SUM([distance]) OVER(PARTITION BY YEAR([startTimeLocal])) / 1000, '#,0.00 KM') AS [TotalDistanceKMByYear]
       ,FORMAT(SUM([distance]) OVER(PARTITION BY YEAR([startTimeLocal]), MONTH([startTimeLocal])) / 1000, '#,0.00 KM') AS [TotalDistanceKMByMonth]
       ,FORMAT(SUM(CASE WHEN DATEDIFF(DAY, [startTimeLocal], GETDATE()) <= 7 THEN [distance] ELSE 0 END) OVER() / 1000, '#,0.00 KM') AS [DistanceKMLast7Days]
       ,FORMAT(SUM(CASE WHEN DATEDIFF(DAY, [startTimeLocal], GETDATE()) > 7 AND DATEDIFF(DAY, [startTimeLocal], GETDATE()) <= 14 THEN [distance] ELSE 0 END) OVER() / 1000, '#,0.00 KM') AS [DistanceKMPrev7Days]
       ,FORMAT(SUM(CASE WHEN DATEDIFF(DAY, [startTimeLocal], GETDATE()) <= 30 THEN [distance] ELSE 0 END) OVER() / 1000, '#,0.00 KM') AS [DistanceKMLast30Days]
       ,FORMAT(SUM(CASE WHEN DATEDIFF(DAY, [startTimeLocal], GETDATE()) > 30 AND DATEDIFF(DAY, [startTimeLocal], GETDATE()) <= 60 THEN [distance] ELSE 0 END) OVER() / 1000, '#,0.00 KM') AS [DistanceKMPrev30Days]
       ,CONVERT(time(0), DATEADD(SECOND, CONVERT(int, [duration]), 0)) AS [Duration]
       ,FORMAT([calories], '#,0 C') AS [Calories]
       ,ISNULL(FORMAT([steps], '#,0'), '') AS [Steps]
       ,[activity] AS [ActivityRAW]
FROM    OPENJSON(@json, '$')
WITH    (
            [activityId]      bigint          '$.activityId'
           ,[activityName]    nvarchar(255)   '$.activityName'
           ,[startTimeLocal]  datetime        '$.startTimeLocal'
           ,[startTimeGMT]    datetime        '$.startTimeGMT'
           ,[activityType]    varchar(50)     '$.activityType.typeKey'
           ,[eventType]       varchar(50)     '$.eventType.typeKey'
           ,[distance]        decimal(18, 6)  '$.distance'
           ,[duration]        decimal(18, 6)  '$.duration'
           ,[calories]        decimal(18, 6)  '$.calories'
           ,[steps]           int             '$.steps'
           ,[activity]      nvarchar(MAX)   '$' AS JSON
        )
ORDER BY [StartTimeGMT] DESC;

/*
SELECT  j1.[Key], [j2].[Key]
                 ,[j2].[Value]
                 ,[j2].[Type]
FROM    OPENJSON(@json, '$') j1
CROSS APPLY OPENJSON(j1.[Value], '$') j2
*/

